export default class Footer extends Component {
    render() {
        return (
            <div className='Footer'>
                <p className='container'>
                    © 2024 All Rights Reserved | Design by
                    <span>
                        Trần Lưu Ngọc Anh "siêu cấp đẹp trai"
                    </span>
                    .
                </p>

            </div>
        )
    }
}
